import React from 'react';
import AuthService from '../../service/AuthService'

import Navbar from "react-bootstrap/Navbar";
import Nav from "react-bootstrap/Nav";


const Navigation = (props) => {

    const authService = new AuthService();

    const logout = () => {
      authService.logout()
        .then(() => {
          props.setTheUser(false);
        })
        .catch((err) => console.log(err));
    };

    return (
      // <Navbar bg="dark" variant="dark">
      //   <Navbar.Brand href="/">Las poesías de la abuela</Navbar.Brand>
      //   <Nav className="mr-auto">
      //     <Nav.Link href="/poesias">Poesías</Nav.Link>
      //     <Nav.Link href="/quien-soy">Sobre mí</Nav.Link>
      //   </Nav>
      //   <Nav>
      //     {props.loggedInUser ? (
      //       <>
      //         <Nav.Link href="/perfil">Administración</Nav.Link>
      //         <Nav.Link href="/" onClick={logout}>
      //           Cerrar sesión
      //         </Nav.Link>
      //       </>
      //     ) : (
      //       <>
      //         <Nav.Link href="/iniciar-sesion">Iniciar sesión</Nav.Link>
      //         <Nav.Link href="/registro">Registro</Nav.Link>
      //       </>
      //     )}
      //   </Nav>
      // </Navbar>

      <Navbar
        className="navbar"
        collapseOnSelect
        expand="lg"
        bg="dark"
        variant="dark"
      >
        <Navbar.Brand className="brand" href="/" id="nav">
          Las poesías de la abuela
        </Navbar.Brand>
        <Navbar.Toggle aria-controls="responsive-navbar-nav" />
        <Navbar.Collapse id="responsive-navbar-nav">
          <Nav className="mr-auto">
            <Nav.Link href="/poesias">Poesías</Nav.Link>
            <Nav.Link href="/quien-soy">Sobre mí</Nav.Link>
          </Nav>

          {props.loggedInUser ? (
             <Nav>
               <Nav.Link href="/perfil">Administración</Nav.Link>
               <Nav.Link href="/" onClick={logout}>
                 Cerrar sesión
               </Nav.Link>
             </Nav>
           ) : (
             <Nav>
               <Nav.Link href="/iniciar-sesion">Iniciar sesión</Nav.Link>
               <Nav.Link href="/registro">Registro</Nav.Link>
             </Nav>
           )}
        </Navbar.Collapse>
      </Navbar>
    );
}

export default Navigation;
